import React from 'react'
import Navbar from '../components/Navbar'
import Footer from '../components/Footer'
import Banner from '../components/Banner'
import CarCard from '../components/CarCard'
import NavbarLoggedIn from '../components/NavbarLoggedin'
import FooterLoggedIn from '../components/FooterLoggedIn'

const OurModels = () => {

    var AuthNavbar = '';
    var AuthFooter = '';

if(localStorage.getItem('auth_token'))

{

    AuthNavbar = (
     <NavbarLoggedIn/>
                );

    AuthFooter = (
     <FooterLoggedIn/>
                );


} else {

  AuthNavbar = (
     <Navbar/>
                );

    AuthFooter = (
     <Footer/>
                );            

    
}





  return (
    <div>
      <div className="empty_space"></div>
      {AuthNavbar}
      <Banner title="Modelljeink" />

      <div className="filter_container">
        <form>
          <br />
          V치lasszon kateg칩ri치t!
          <label>
            Kateg칩ria
            <select>
              <option value="" selected disabled hidden>
                ---
              </option>
              <option value="grapefruit">Furgon</option>
              <option value="lime">Sedan</option>
              <option value="">Kombi</option>
              <option value="mango">Hibrid</option>
            </select>
          </label>
        </form>
      </div>


      <div className="car_card_container">
      <CarCard />
      <CarCard />
      <CarCard />
      </div>



      {AuthFooter}


    </div>
  )
}

export default OurModels
